import React from "react";
import styled from "styled-components";

const LeaguesComponent = styled.div`
  .leagues {
    display: flex;
    flex-direction: column;
    width: 30%;
    min-width: 400px;
    margin: 25px;
    padding: 20px;
    border: 2px solid var(--border_light);
    border-radius: 5px;
    background-color: var(--navbar_color);
    color: #fff;
  }

  .leagues .topping {
    padding: 10px;
    margin: 0;
    color: #fff;
    font-weight: normal;
  }
`;

function Leagues({ leagues, title }) {
  return (
    <LeaguesComponent>
      <div className="leagues">
        <h3 className="topping">{title}</h3>
        {Object.keys(leagues).map((league) => (
          <div>
            <span>{leagues[league].name}</span>
          </div>
        ))}
      </div>
    </LeaguesComponent>
  );
}

export default Leagues;
